import React from 'react'
import skills from '../../data/skills.json';
import img from '../../assets/';
export const Experience = () => {
    return (
        <section id="experience">
            <h2>Experience</h2>
            <div>
                <div>
                    {
                        skills.map((skills, id) => {
                            return <div key={id}>
                                <img src={img(skills.imageSrc)} alt={skills.title} />
                            </div>
                        })
                    }
                </div>
                <ul>

                </ul>

            </div>
        </section>
    )
}
